function l(i,n,c){if(typeof i=="object")for(const f in i){const y=i[f];switch(typeof i[f]){case"object":const t=[];for(const o in n)t[o]=n[o][f];l(y,t,c);break;case"number":let e=0;for(const o in n)e+=n[o][f]*c[o];i[f]=e;break}}}function b(i,n,c,f){let y=0;for(const t in i){n[t]=0;for(const o in c){const a=c[o][t]||0,K=f[o];n[t]+=Math.abs(a-K)**3}const e=1/n[t];n[t]=e,y+=e}if(y!=1/0)for(const t in n){const e=t;n[e]/=y}else{let t=0;for(const e in n)n[e]==1/0&&t++;for(const e in n){const o=e;n[o]!=1/0?n[o]=0:n[o]=1/t}}}export{l as a,b as s};
